//   {path:'/CONTACT',element:<CONTACT/>}
// ]);
const App = () => {
  return (
    <Routes>
      <Header />
      <main style={{minHeight:'90vh'}}>
        {/* <RouterProvider router={Router} /> */}
        <Route path='/'>
          <HOME/>
        </Route>
        <Route path='/STORE'>
          <STORE/>
        </Route>
        <Route path='/ABOUT'>
          <ABOUT/>
        </Route>
        <Route path='/CONTACT'>
          <CONTACT/>
        </Route>
      </main>
      <Footer/>
    </Routes>
  );
};

export default App;
